DROP TABLE IF EXISTS `alerts`;
CREATE TABLE `alerts` (
  `id` varchar(64) COLLATE utf8_bin NOT NULL,
  `msg` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '告警消息',
  `type` int(10) DEFAULT NULL COMMENT '0-资源告警，1-容器异常',
  `status` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '未触发，待触发，触发中',
