  `rule` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '告警策略',
  `created` datetime(6) DEFAULT NULL COMMENT '创建时间',
  `read` int(10) DEFAULT '0' COMMENT '是否已读，0-未读，1-已读',
  `username` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '接收消息的用户',
  `workspace` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '工作空间',
  `namespace` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '用户项目',
  `app` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '关联应用',
  `remark` varchar(255) COLLATE utf8_bin DEFAULT NULL,
  `meta` longtext COLLATE utf8_bin COMMENT '接口数据',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_bin;

