DROP TABLE IF EXISTS `nodes`;
CREATE TABLE `nodes` (
  `node` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '节点系统名称',
  `machine` varchar(255) COLLATE utf8_bin NOT NULL COMMENT '节点uid',
  `name` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '节点别名',
  `cpu` decimal(64,2) NOT NULL COMMENT '总CPU资源',
  `mem` decimal(64,2) NOT NULL DEFAULT '0.00' COMMENT '总内存资源',
  `disk` decimal(64,2) NOT NULL DEFAULT '0.00' COMMENT '总磁盘资源',
  `gpu` decimal(64,2) NOT NULL DEFAULT '0.00' COMMENT '总GPU资源',
  `inode` decimal(64,2) DEFAULT NULL COMMENT 'inode总',
  `pod` int(64) DEFAULT NULL COMMENT '总容器数',
  `ip` varchar(255) COLLATE utf8_bin NOT NULL COMMENT 'ip信息',
  `nodePorts` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '可使用的端口',
  `status` varchar(32) COLLATE utf8_bin NOT NULL DEFAULT '0' COMMENT '0-可分配，1-不可分配',
  `sshPort` int(6) DEFAULT NULL COMMENT 'ssh端口',
  `password` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT '密码',
  `cert` varchar(255) COLLATE utf8_bin DEFAULT NULL COMMENT 'ssh密钥',
