  `gpu_used` decimal(64,2) DEFAULT NULL COMMENT 'GPU使用',
  `inode_used` decimal(64,2) DEFAULT NULL COMMENT '已使用inode',
  `pod_used` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '已运行pod数量',
  `cpu_limit` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT 'cpu资源限制',
  `cpu_request` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT 'cpu资源预留',
  `mem_limit` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '内存资源限制',
  `mem_request` varchar(64) COLLATE utf8_bin DEFAULT NULL COMMENT '内存资源预留',
  `conditions` longtext COLLATE utf8_bin COMMENT '网络配置、内存压力、磁盘压力、进程压力、容器组接收',
  `updated` datetime DEFAULT NULL ON UPDATE CURRENT_TIMESTAMP,
  `role` varchar(32) COLLATE utf8_bin DEFAULT NULL COMMENT '角色',
  `type` int(6) DEFAULT '0' COMMENT '0-物理机，1-虚拟机',
  PRIMARY KEY (`machine`),
  UNIQUE KEY `ip_unique` (`ip`) USING HASH,
  KEY `machine_unique` (`machine`)
