-- ----------------------------
-- View structure for resources_usage_view
-- ----------------------------
DROP VIEW IF EXISTS `resources_usage_view`;
CREATE ALGORITHM = UNDEFINED SQL SECURITY DEFINER VIEW `resources_usage_view` AS select `resources`.`machine` AS `nid`,sum(`resources`.`cpu`) AS `cpuUsage`,sum(`resources`.`mem`) AS `memUsage`,sum(`resources`.`disk`) AS `diskUsage`,sum(`resources`.`gpu`) AS `gpuUsage` from `resources` where (`resources`.`machine` is not null) group by `resources`.`machine`,`resources`.`cpu`,`resources`.`mem`,`resources`.`gpu`,`resources`.`disk`;

SET FOREIGN_KEY_CHECKS = 1;
